// Import necessary dependencies
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel, Card, Button } from 'react-bootstrap';

// Styles for the Landingpage component
const containerStyle = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
};

const headerStyle = {
  backgroundColor: '#3498db',
  padding: '20px',
  color: '#fff',
  textAlign: 'center',
};

const carouselCaptionStyle = {
  textAlign: 'left',
  left: '5%',
  right: '5%',
  bottom: '20%',
};

const sectionStyle = {
  padding: '20px',
  textAlign: 'center',
};

const formStyle = {
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
};

const mapContainerStyle = {
  padding: '20px',
  textAlign: 'center',
};

const footerStyle = {
  backgroundColor: '#2c3e50',
  padding: '20px',
  color: '#fff',
  textAlign: 'center',
};

// Define the Landingpage component
const Landingpage = () => {
  return (
    <>
      {/* Header */}
      <div style={containerStyle}>
        <header style={headerStyle}>
          <h1>Hospital Management System</h1>
        </header>

        {/* Carousel */}
        <Carousel interval={5000} pause={false} style={{ width: '100%', height: '400px' }}>
          {/* Slide 1 */}
          <Carousel.Item>
            <img
              className="d-block w-100"
              src="https://www.missouripartnership.com/wp-content/uploads/2018/01/iStock-695349930-scaled.jpg"
              alt="First slide"
              style={{ width: '100%', height: '100%' }}
            />
            <Carousel.Caption style={carouselCaptionStyle}>
              <h1>Welcome to Clinical Automation System</h1>
              <p>Your trusted partner in healthcare management</p>
            </Carousel.Caption>
          </Carousel.Item>

          {/* Slide 2 */}
          <Carousel.Item>
            <img
              className="d-block w-100"
              src="https://www.missouripartnership.com/wp-content/uploads/2018/01/iStock-695349930-scaled.jpg"
              alt="Second slide"
              style={{ width: '100%', height: '100%' }}
            />
            <Carousel.Caption style={{ ...carouselCaptionStyle, bottom: '10%' }}>
              <h1>Welcome to Clinical Automation System</h1>
              <p>We care for your Health</p>
            </Carousel.Caption>
          </Carousel.Item>

          {/* Add more Carousel.Items for additional slides */}
          {/* Example: */}
          <Carousel.Item>
            <img
              className="d-block w-100"
              src="https://example.com/third-image.jpg"
              alt="Third slide"
              style={{ width: '100%', height: '100%' }}
            />
            <Carousel.Caption style={carouselCaptionStyle}>
              <h1>Welcome to Clinical Automation System</h1>
              <p>Additional caption for the third slide</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>


<section>
    
</section>
      

      {/* Contact Us */}
      <div>
        <section style={{ ...sectionStyle, backgroundColor: '#ecf0f1' }}>
          <h2>Contact Us</h2>
          <p>For inquiries, please contact us at <strong>info@examplehospital.com</strong>.</p>
        </section>
      </div>

      {/* Footer */}
      <div>
        <footer style={footerStyle}>
          <p>&copy; 2023 Hospital Management System</p>
        </footer>
      </div>
    </>
  );
  
};

// Export the Landingpage component
export default Landingpage;
